var getGroundHeight = function (x, z) {
    var positions = nx.ground.getVerticesData(BABYLON.VertexBuffer.PositionKind);
    var subdivisions = nx.ground.subdivisions;
    var flip = false;
    var val = (x + z * subdivisions) * 2;
    if (z % 2 == 0) flip = !flip;
    if (!flip) val += 1;
    // return positions[(val - 0) * 9 + 2 * 3 + 1];
    var idx = (val - 0) * 9 + 2 * 3 + 1;
    var posY = positions[idx];
    if(!posY){
        console.log('NOTHEIGHT',idx, positions.length)
    }else{
        console.log(idx);
    }
    return posY;
}

var tilePositionFromWorldPosition = function (x, z) {
    var size = nx.ground.size;
    var subdivisions = nx.ground.subdivisions;
    var tileSize = size / subdivisions;
    var position = {};
    position.z = Math.ceil((z + size / 2 * 0.86602540378) / tileSize / 0.86602540378);
    if (position.z % 2 == 0) position.x = Math.ceil((x + size / 2) / tileSize);
    else position.x = Math.ceil((x + size / 2 - tileSize / 2) / tileSize);
    return position;
}
